import React, { useEffect, useState } from 'react'
import UserService from '../../services/UserService'

const Users = () => {
    const [users, setUsers] = useState([])

    useEffect(() => {
        const fetchUsers = async () => {
            const res = await UserService.getUsers()
            setUsers(res.data)
        }
        fetchUsers()
    }, [])

  return (
    <div>
        <h1>Пользователи</h1>
        <div>
            {users.map(user => 
                <div>
                    user.name
                </div>
            )}    
        </div>    
    </div>
  )
}

export default Users
